import React, { useState, useEffect } from 'react';
import { withGoogleMap, withScriptjs, GoogleMap, Marker, InfoWindow } from 'react-google-maps';
// import * as parkData from "./data/skateboard-parks.json";
import mapStyles from './mapStyle';
import { db, getLoggedInUser } from '../../../helpers/auth';

function Map() {
    const [selectedPark, setSelectedPark] = useState(null);
    const [user, setUser] = useState(getLoggedInUser());
    const [postloc, setPostLoc] = useState([]);
    const [lonn, setLon] = useState();
    const [latt, setLat] = useState();

    useEffect(() => {
        const listener = (e) => {
            if (e.key === 'Escape') {
                setSelectedPark(null);
            }
        };
        window.addEventListener('keydown', listener);

        return () => {
            window.removeEventListener('keydown', listener);
        };
    }, []);

    useEffect(() => {
        const fetchPost = async () => {
            const posts = [];
            const postpoint = await db.collectionGroup('userPosts').where('postVerified', '==', true).get();
            postpoint.forEach(function (doc) {
                // doc.data() is never undefined for query doc snapshots

                posts.push({
                    id: doc.id,
                    ...doc.data(),
                });
                console.log(doc.id, ' => ', doc.data());
            });

            setPostLoc(posts);
            console.log('post', posts);
        };

        fetchPost();
    }, []);

    navigator.geolocation.getCurrentPosition((position) => {
        console.log('1', position.coords.longitude);
        // lon = position.coords.longitude;
        setLat(position.coords.latitude);
        setLon(position.coords.longitude);
        // lat = position.coords.latitude;
    });

    const lat = parseFloat(user.latitude);
    const long = parseFloat(user.longitude);

    //   const points = postloc.map((crime) => ({
    //     type: "Feature",
    //     properties: { cluster: false , crimeid: crime.id, crimeTiTle: crime.Title, crimeCategory: crime.category},
    //     geometry: {
    //         type: "Point",
    //         coordinates: [parseFloat(crime.longitude), parseFloat(crime.latitude)],
    //     },
    // }));
    const usere = getLoggedInUser()

    return (
        <GoogleMap
            defaultZoom={10}
            defaultCenter={{ lat: usere.lat, lng: usere.lon }}
            // defaultOptions={{ styles: mapStyles }}
        >
            {postloc.map((crime) => {
                
           if(crime.category === 'Arrest'){
           return <Marker
                    key={crime.id}
                    position={{
                        lat: parseFloat(crime.latitude),
                        lng: parseFloat(crime.longitude),
                    }}
                    onClick={() => {
                        setSelectedPark(crime);
                    }}
                    icon={{
                        url: 'data:image/png;base64,',
                        scaledSize: new window.google.maps.Size(25, 25),
                    }}
                />

           } 
           else if (crime.category === 'Theft'){
            return <Marker
                    key={crime.id}
                    position={{
                        lat: parseFloat(crime.latitude),
                        lng: parseFloat(crime.longitude),
                    }}
                    onClick={() => {
                        setSelectedPark(crime);
                    }}
                    icon={{
                        url: "data:image/png;base64,",
                        scaledSize: new window.google.maps.Size(25, 25),
                    }}
                />
           }  else if (crime.category === 'Shooting'){
            return <Marker
                    key={crime.id}
                    position={{
                        lat: parseFloat(crime.latitude),
                        lng: parseFloat(crime.longitude),
                    }}
                    onClick={() => {
                        setSelectedPark(crime);
                    }}
                    icon={{
                        url: 'data:image/png;base64,',
                        scaledSize: new window.google.maps.Size(25, 25),
                    }}
                />
           }
              
             
            })}
            {console.log('selected', latt)}
            {selectedPark && (
                <InfoWindow
                    onCloseClick={() => {
                        setSelectedPark(null);
                    }}
                    position={{
                        lat: parseFloat(selectedPark.latitude),
                        lng: parseFloat(selectedPark.longitude),
                    }}
                >
                    <div>
                        <h2>{selectedPark.Title}</h2>
                        <p>{selectedPark.category}</p>
                    </div>
                </InfoWindow>
            )}
        </GoogleMap>
    );
}

const MapWrapped = withScriptjs(withGoogleMap(Map));

export default function App() {
    return (
        <div style={{ width: '100vw', height: '100vh' }}>
            <MapWrapped
                googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=${process.env.REACT_APP_GOOGLE_KEY}`}
                loadingElement={<div style={{ height: `100%` }} />}
                containerElement={<div style={{ height: `100%` }} />}
                mapElement={<div style={{ height: `100%` }} />}
            />
        </div>
    );
}
